import logo from './logo.svg';
import './App.css';
import React from 'react';
import { ListEvents } from './components/ListEvents';
import { Header } from './components/Header';
import { Footer } from './components/Footer';

function App() {
  return (
    <div className="App">
      <Header></Header>
      <ListEvents/>
      <Footer></Footer>
    </div>
  );
}

export default App;
